import React from 'react';

function Nav() {
    return(
        <header>
            <h1>
                <a href='/'>Peter Stenger</a>
            </h1>
            <nav>
                <ul className="flex-row">
                    <li className="mx-2">
                        <a href="#about">About</a>
                    </li>
                </ul>
            </nav>
        </header>
    )
}

export default Nav;
